// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AccessControl {
    address public owner;
    mapping(address => bool) public admins;
    mapping(address => bool) public verifiers;
    mapping(address => bool) public creators;

    event AdminAdded(address admin);
    event AdminRemoved(address admin);
    event VerifierAdded(address verifier);
    event VerifierRemoved(address verifier);
    event CreatorAdded(address creator);
    event CreatorRemoved(address creator);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not the owner");
        _;
    }

    modifier onlyAdmin() {
        require(admins[msg.sender], "Not an admin");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function addAdmin(address _admin) external onlyOwner {
        require(!admins[_admin], "Already an admin");
        admins[_admin] = true;
        emit AdminAdded(_admin);
    }

    function removeAdmin(address _admin) external onlyOwner {
        require(admins[_admin], "Not an admin");
        admins[_admin] = false;
        emit AdminRemoved(_admin);
    }

    function addVerifier(address _verifier) external onlyAdmin {
        verifiers[_verifier] = true;
        emit VerifierAdded(_verifier);
    }

    function removeVerifier(address _verifier) external onlyAdmin {
        verifiers[_verifier] = false;
        emit VerifierRemoved(_verifier);
    }

    function addCreator(address _creator) external onlyAdmin {
        creators[_creator] = true;
        emit CreatorAdded(_creator);
    }

    function removeCreator(address _creator) external onlyAdmin {
        creators[_creator] = false;
        emit CreatorRemoved(_creator);
    }

    function isVerifier(address _address) external view returns (bool) {
        return verifiers[_address];
    }

    function isCreator(address _address) external view returns (bool) {
        return creators[_address];
    }
}
